import './App.css';
import logo from './Assets/logo.png';


function App() {
  return (
    <div>
      <div className='gameContainer'></div>
      <div className='logoContainer'>
        <img src={logo} className='logo' alt="game logo" />
      </div>

    </div>



  );
}

export default App;
